import React from 'react';
import { Link } from 'react-router-dom';
import '../styles/Sidebar.css';

const Sidebar = () => {
  return (
    <div className="sidebar-container">
      {/* Minimal Sidebar Button */}
      <button className="sidebar-button">haX</button>

      {/* Dropdown Menu */}
      <div className="dropdown">
        <Link to="/">
          <img src="/icons/home.svg" alt="Home Icon" className="icon" /> Home
        </Link>
        <Link to="/community">
          <img src="/icons/global.svg" alt="Community Icon" className="icon" /> Community
        </Link>
        <Link to="/saved">
          <img src="/icons/save.svg" alt="Saved Icon" className="icon" /> Saved
        </Link>
        <Link to="/reward">
          <img src="/icons/coin.svg" alt="Reward Icon" className="icon" /> Reward
        </Link>

        {/* Profile Section */}
        <div className="profile-section">
          <img src="/icons/ellipse.svg" alt="Profile Icon" />
          <div className="descriptions">
            <h3>William Pan</h3>
            <p>20 Days at Do.ai</p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Sidebar;
